import React from "react";
import { BrowserRouter as Router, Switch, Routes } from "react-router-dom";
import Home from "./routes/Home";
import UpdatePatient from "./routes/UpdatePatient";
import PatientDetails from "./routes/PatientDetails";

const App = () => {
    return <div>
        <Router>
            <Routes>

                <Switch path="/" element={<Home />} />

                <Switch path="/patients/:id/update" element={<UpdatePatient />} />

                <Switch path="/patients/:id" element={<PatientDetails />} />

            </Routes>
        </Router>
    </div>
}

export default App;
